import {
    Button,
    Center
} from '@chakra-ui/react'
import './home.css'

const Home = () => {
  return (
    <>
    <div className = 'container'>
        Title
    </div>
    <Center>
        <Button colorScheme='blue'>Button</Button>
    </Center>
    </>
    )
}

export default Home
